# This file contains common pin mappings for the BIGTREETECH Manta M5P
# To use this config, the firmware should be compiled for the
# STM32G0B1 with a "8KiB bootloader" "8 MHz crystal"
# and "USB (on PA11/PA12)" or "CAN bus (on PD0/PD1)".

# See docs/Config_Reference.md for a description of parameters.

[respond]
# [include ebb-canbus-v1.2.cfg]
# [include adxl.cfg] # Comment this out when you disconnect the accelerometer
# [include adxl345.cfg]
# [include cartographer.cfg]
[include chopper_tune.cfg]
[include input_shaping.cfg]
[include fwretraction.cfg]
[include macros.cfg]
[include mainsail.cfg]
[include shell_command.cfg]
[include sensorless.cfg]
[include speedtest.cfg]
[include KAMP_Settings.cfg]
[include nozzlewiper.cfg]
[include klicky/klicky-probe.cfg]
[include tmc.cfg]
# [include tmc_autotune.cfg]

[mcu]
# serial: /dev/serial/by-id/usb-Klipper_stm32g0b1xx_08002B000C504B5735313920-if00
canbus_uuid=c7b31ed2d4a5

# Enable object exclusion
[exclude_object]

[skew_correction]

[idle_timeout]
timeout: 2100

# Enable arcs support
[gcode_arcs]
resolution: 0.1

[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
#    The folder where the results will be stored. It will be created if it doesn't exist.
number_of_results_to_keep: 3
#    The number of results to keep in the result_folder. The oldest results will
#    be automatically deleted after each runs.
keep_raw_csv: False
#    If True, the raw CSV files will be kept in the result_folder alongside the
#    PNG graphs. If False, they will be deleted and only the graphs will be kept.
show_macros_in_webui: True
#    Mainsail and Fluidd doesn't create buttons for "system" macros that are not in the
#    printer.cfg file. If you want to see the macros in the webui, set this to True.
# timeout: 300
#    The maximum time in seconds to let Shake&Tune process the CSV files and generate the graphs.

[temperature_sensor MCU]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[temperature_sensor Host]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

# [temperature_sensor CAN] 
# sensor_type: temperature_mcu
# sensor_mcu: EBBCan
# min_temp: 0
# max_temp: 100

[printer]
kinematics: corexy
max_velocity: 400
max_accel: 20000
max_z_velocity: 25
max_z_accel: 300
square_corner_velocity: 50.0

#####################################################################
#      X/Y Stepper Settings
#####################################################################

[stepper_x]
step_pin: PC8
dir_pin: PC9
enable_pin: !PA15
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200                                        # Set to 400 for 0.9째 degree stepper motor, 200 is for 1.8째 stepper motors
endstop_pin: tmc2209_stepper_x:virtual_endstop                      # Using Virtual Endstop or sensorless homing, make sure you install the jumper on the controller under the stepper
position_endstop: 120
position_max: 120
position_min: 0
homing_speed: 70                                                    # for sensorless homing it is recommended not to go above 40mm/s  
homing_retract_dist: 0

[stepper_y]
step_pin: PA10
dir_pin: PA14
enable_pin: !PA13
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200                                        # Set to 400 for 0.9째 degree stepper motor, 200 is for 1.8째 stepper motors
endstop_pin: tmc2209_stepper_y:virtual_endstop                      # Using Virtual Endstop or sensorless homing, make sure you install the jumper on the controller under the stepper
position_endstop: 120
position_max: 120
position_min: 0
homing_speed: 70                                                    # for sensorless homing it is recommended not to go above 40mm/s  
homing_retract_dist: 0

#####################################################################
#   Z Stepper Settings
#####################################################################

[stepper_z]
step_pin: PC6
dir_pin: !PC7
enable_pin: !PA9
rotation_distance: 8                                                # For T8x8 integrated lead screw
microsteps: 128
endstop_pin: ^PC2
#position_endstop: 120
position_max: 120
position_min: -1.5
homing_speed: 15
second_homing_speed: 2.0
homing_retract_dist: 3.0

#####################################################################
#   Extruder
#####################################################################

[extruder]
step_pin: PB12
dir_pin: PB11
enable_pin: !PA8
rotation_distance: 9.42916
# rotation_distance: 22.39426                                           # See calibrating rotation_distance on extruders doc
# gear_ratio: 50:10                                                     # For Mini Afterburner
gear_ratio: 44:10, 37:17
microsteps: 32
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: PC5
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: PA1
min_temp: 0
max_temp: 300
min_extrude_temp: 0
max_extrude_only_distance: 150
max_extrude_cross_section: 5
pressure_advance: 0.028                                               # See tuning pressure advance doc
pressure_advance_smooth_time: 0.020

[verify_heater extruder]
max_error: 120
check_gain_time: 20
hysteresis: 5
heating_gain: 2

#sensor_type:MAX31865
#sensor_pin: PA4
#spi_bus: spi1
#rtd_nominal_r: 100
#rtd_reference_r: 430
#rtd_num_of_wires: 2

#[filament_switch_sensor material_0]
#switch_pin: PC2

#[extruder1]
#step_pin: PB0
#dir_pin: PB1
#enable_pin: !PC4
#heater_pin: PA7
#sensor_pin: PA2
#...

#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
heater_pin: PA5
sensor_type: Generic 3950
sensor_pin: PA0
smooth_time: 3.0
min_temp: 0
max_temp: 120
control = pid
pid_kp = 63.273
pid_ki = 2.256
pid_kd = 443.703

[verify_heater heater_bed]
max_error: 120
check_gain_time: 60
hysteresis: 5
heating_gain: 2

#####################################################################
#   Fan Control
#####################################################################

[heater_fan hotend_fan]
pin: PA4
max_power: 1.0
kick_start_time: 1.5
heater: extruder
heater_temp: 50.0
fan_speed: 0.9                                                      # You can't PWM the delta fan unless using blue wire

[fan]
pin: PA3
max_power: 1.0
kick_start_time: 0.10                                               # Depending on your fan, you may need to increase this value if your fan will not start
off_below: 0.06
cycle_time: 0.010

#[heater_fan SoC_fan]
#pin: gpio79 # CB1
##pin: gpio26 # RPI
#max_power: 1.0
#kick_start_time: 0.5                                               # Depending on your fan, you may need to increase this value if your fan will not start
#off_below: 0.13
#cycle_time: 0.010

[neopixel caselight]
pin: PC11
chain_count: 20
color_order: GRB
#initial_RED: 0
#initial_GREEN: 0
#initial_BLUE: 0
initial_RED: 0.7059
initial_GREEN: 0.549
initial_BLUE: 0.3529

[bed_screws]
screw1: 5,115
screw1_name: back left
screw2: 115,115
screw2_name: back right
screw3: 60,5
screw3_name: front screw

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PD5, EXP1_3=PB3, EXP1_5=PB5, EXP1_7=PB7, EXP1_9=<GND>,
    EXP1_2=PD4,  EXP1_4=PD6, EXP1_6=PB4, EXP1_8=PB6, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PB14, EXP2_3=PB8, EXP2_5=PC10, EXP2_7=PC12,  EXP2_9=<GND>,
    EXP2_2=PB13, EXP2_4=PB9, EXP2_6=PB15, EXP2_8=<RST>, EXP2_10=<NC>

