#####################################################################
#      Klicky probe
#####################################################################
[probe]
# #with Longer Klicky Probe
pin: ^PC3
# #x_offset: 8 #(9.5 with front cowling)
x_offset: 1
y_offset: -1
#z_offset: 14.5
speed: 5
lift_speed: 5

samples: 3
samples_result: median
sample_retract_dist: 2
samples_tolerance: 0.01
samples_tolerance_retries: 10

# [probe]
# z_offset = 14.500
